import BatsmenItem from './BatsmenItem';

function BatsmenBox(props) {

    return (
        <div className="batsmen_box">
            <BatsmenItem name="Kohli" runs="73*" balls ="45" not_out="*"/>
            <BatsmenItem name="Pant" runs="61" balls ="38" not_out=" "/>
            <BatsmenItem name="Pandya" runs="38" balls ="21" not_out=" "/>
            <BatsmenItem name="Rohit" runs="20" balls ="18" not_out=" "/>
        </div>
    )

    }
export default BatsmenBox;
